$(".mh-ajax-btn-update").off("click").on("click",function(t){return $.ajax({dataType:"html",evalScripts:!0,url:$(this).attr("href"),beforeSend:function(a){$($(t.target).attr("mh-indicator")).fadeIn()},success:function(a,e){$($(t.target).attr("mh-update")).html(a)},complete:function(a,e){$($(t.target).attr("mh-indicator")).fadeOut()}}),!1});